import React, { useEffect, useState } from 'react';
import { useAuth } from '../context/AuthContext';
import { getProfile } from '../services/auth';

export function Profile() {
  const { state, logout } = useAuth();
  const [loading, setLoading] = useState(false);
  const [profile, setProfile] = useState<any>(null);
  const [error, setError] = useState<string | null>(null);

  useEffect(() => {
    (async () => {
      setLoading(true);
      setError(null);
      try {
        const token = state.accessToken;
        if (!token) throw new Error('Нет токена доступа');
        const data = await getProfile(token);
        setProfile(data?.data?.user || null);
      } catch (e) {
        setError('Не удалось загрузить профиль');
      } finally {
        setLoading(false);
      }
    })();
  }, [state.accessToken]);

  if (loading) return <div>Загрузка профиля...</div>;
  if (error) return <div style={{ color: 'red' }}>{error}</div>;

  return (
    <div style={{ display: 'grid', gap: 16 }}>
      <section>
        <h3 style={{ marginBottom: 8 }}>Личный кабинет</h3>
        {profile ? (
          <div style={{ display: 'grid', gap: 6 }}>
            <div><strong>Email:</strong> {profile.email}</div>
            <div><strong>Имя пользователя:</strong> {profile.username || '—'}</div>
            <div><strong>Роль:</strong> {profile.role}</div>
            <div><strong>Email подтвержден:</strong> {profile.email_verified ? 'да' : 'нет'}</div>
          </div>
        ) : (
          <div>Нет данных профиля</div>
        )}
      </section>

      <section style={{ display: 'grid', gap: 8 }}>
        <h4>Редактирование профиля</h4>
        <div style={{ display: 'grid', gap: 8, maxWidth: 420 }}>
          <input placeholder="Имя пользователя" defaultValue={profile?.username || ''} />
          <input placeholder="Полное имя" defaultValue={profile?.full_name || ''} />
          <input placeholder="URL аватара" defaultValue={profile?.avatar_url || ''} />
          <button disabled>Сохранить (скоро)</button>
        </div>
      </section>

      <section style={{ display: 'grid', gap: 8 }}>
        <h4>Смена пароля</h4>
        <div style={{ display: 'grid', gap: 8, maxWidth: 420 }}>
          <input type="password" placeholder="Текущий пароль" />
          <input type="password" placeholder="Новый пароль" />
          <input type="password" placeholder="Повтор нового пароля" />
          <button disabled>Изменить пароль (скоро)</button>
        </div>
      </section>

      <div>
        <button onClick={logout}>Выйти</button>
      </div>
    </div>
  );
}
